let getData = []
const generateData = () => {
	let i = 2000
	while(i < 2045){
		getData.push(i)
		i++; 
	}
}

export const Data = () => {
	let i = 0
	let arrays = []
	 while(i < 5){
		arrays.push(i)
		i++
	}
	return arrays
}
